"use strict";function initQueueList(){$("[data-manage-customer-id]").click(function(){var n=$(this).attr("data-manage-customer-id");isNaN(n)||(setLoading(),$("#ManageCustomerModal").load(window.viewData.manageCustomerModalUrl+"?customerId="+n,function(){clearLoading();$("#ManageCustomerModal").modal("show")}))});$("#businessViewQueueList .list-group").sortable({delay:100}).on("sort",$.debounce(window.viewData.sortingDebounce,function(){var n=[],t;$("#businessViewQueueList li[data-manage-customer-id]").each(function(){var t=$(this).attr("data-manage-customer-id");isNaN(t)||n.push(parseInt(t))});t={customerIds:n,__RequestVerificationToken:$('input[name="__RequestVerificationToken"]').val()};$.post(window.viewData.sortQueueUrl,t)}))}$(function(){initQueueList();var n=$.connection.updateHub;n.client.queueUpdated=function(){$("#businessViewQueueList").load(window.viewData.udpateBusinessViewQueueListUrl,function(){initQueueList()})};$.connection.hub.start().done(function(){n.server.subscribeToQueueAsBusiness(window.viewData.queueId)})});